import React from 'react'

function Card(props){
    const { width, height, ...other } = props;

    return(
        <div
            style= {{
                border: "0.5px solid #6663",
                borderRadius: "5px",
                boxShadow: "0px 0px 0.5px 0.5px gray",
                background: '#FFFFFF',
                width: width,
                height: height,
                ...other
            }} 
        >

        </div>
    )


}

export default Card;
